		<h2>About this Site</h2>
		<p>
			Overall, this site sits at only kilobytes in size. The goal was create a page that would be
			responsive, but would be extremely small. The desire was to reduce server costs to a minimum
			and maximize efficiency of load time. To do this I:
		</p>

		<ul>
			<li>Used only a single HTML file for the site</li>
			<li>Favored embedded SVGs over image files</li>
			<li>Favored CSS over JS</li>
			<li>Minified the file before deployment</li>
		</ul>
		<p>
			Of course there is tooling and frameworks that can make this easier, but I kept this basic and
			simple to reduce any pain in long-term maintenance
		</p>

